import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import './App.css';

function App() {
  return(
    <div>

      <Page/>
    </div>
  );  
}

function Page() {
  return (
    <Switch>
      <Route path="/" component={Home}></Route>
      <Route path="/about" component={About}></Route>
      <Route path="/users" component={Users}></Route>
    </Switch>
  );
}

function Home() {
  return(
    <h2>Home</h2>
  )
}

function About() {
  return(
    <h2>About</h2>
  )
}

function Users() {
  return(
    <h2>Users</h2>
  )
}

export default App;
